class Solution(object):
    def minimumChanges(self, s, k):
        n = len(s)
        dp = [[float('inf')] * (k + 1) for _ in range(n + 1)]
        dp[0][0] = 0

        for i in range(1, n + 1):
            for j in range(1, min(k, i) + 1):
                if j == 1:
                    dp[i][j] = min(dp[i][j], self.semiPalindromeCost(s[:i]))
                for l in range(i):
                    dp[i][j] = min(dp[i][j], dp[l][j - 1] + self.semiPalindromeCost(s[l:i]))

        return dp[n][k]

    def semiPalindromeCost(self, s):
        cost = 0
        l = len(s)
        for d in range(1, l):
            if l % d == 0:
                for i in range(d):
                    count = [0] * 26
                    for j in range(i, l, d):
                        count[ord(s[j]) - ord('a')] += 1
                    cost += sum(count) - max(count)
                return cost // (l // d)
        return float('inf')
